import PropTypes from "prop-types";
import { useDropzone } from "react-dropzone";
import AvatarEditor from "react-avatar-editor";
import {
  Box,
  Button,
  IconButton,
  Link,
  List,
  ListItem,
  ListItemIcon,
  ListItemText,
  Tooltip,
  Typography,
} from "@mui/material";
import { Duplicate as DuplicateIcon } from "../../../icons/duplicate";
import { X as XIcon } from "../../../icons/x";
import { bytesToSize } from "../../../utils/bytes-to-size";

export const OrganisationLogoDropzone = (props) => {
  const {
    accept,
    disabled,
    file,
    getFilesFromEvent,
    maxFiles,
    maxSize,
    minSize,
    noClick,
    noDrag,
    noDragEventsBubbling,
    noKeyboard,
    onDrop,
    onDropAccepted,
    onDropRejected,
    onFileDialogCancel,
    onRemove,
    onRemoveAll,
    onUpload,
    preventDropOnDocument,
    ...other
  } = props;

  // We did not add the remaining props to avoid component complexity
  // but you can simply add it if you need to.
  const { getRootProps, getInputProps, isDragActive } = useDropzone({
    accept,
    maxFiles,
    maxSize,
    minSize,
    onDrop,
  });
  return (
    <div {...other}>
      {!file && (
        <Box
          sx={{
            alignItems: "center",
            border: 1,
            borderRadius: 1,
            borderStyle: "dashed",
            borderColor: "divider",
            display: "flex",
            flexWrap: "wrap",
            justifyContent: "center",
            outline: "none",
            p: 6,
            ...(isDragActive && {
              backgroundColor: "action.active",
              opacity: 0.5,
            }),
            "&:hover": {
              backgroundColor: "action.hover",
              cursor: "pointer",
              opacity: 0.5,
            },
          }}
          {...getRootProps()}
        >
          <input {...getInputProps()} />
          <Box
            sx={{
              "& img": {
                width: 100,
              },
            }}
          >
            <img alt="Select file" src="/static/undraw_add_file2_gvbb.svg" />
          </Box>
          <Box sx={{ p: 2 }}>
            <Typography variant="h6">
              {`Select file${maxFiles && maxFiles === 1 ? "" : "s"}`}
            </Typography>
            <Box sx={{ mt: 2 }}>
              <Typography variant="body1">
                {`Drop file${maxFiles && maxFiles === 1 ? "" : "s"}`}{" "}
                <Link underline="always">browse</Link> thorough your machine
              </Typography>
            </Box>
          </Box>
        </Box>
      )}
      {file && (
        <Box sx={{ mt: 2 }}>
          <AvatarEditor width={250} height={250} image={image} />
          <Box
            sx={{
              display: "flex",
              justifyContent: "flex-end",
              mt: 2,
            }}
          >
            <Button onClick={onRemove} size="small" type="button">
              Remove
            </Button>
            <Button
              onClick={onUpload}
              size="small"
              sx={{ ml: 2 }}
              type="button"
              variant="contained"
            >
              Upload
            </Button>
          </Box>
        </Box>
      )}
    </div>
  );
};

OrganisationLogoDropzone.propTypes = {
  accept: PropTypes.oneOfType([
    PropTypes.string,
    PropTypes.arrayOf(PropTypes.string),
  ]),
  disabled: PropTypes.bool,
  file: PropTypes.array,
  getFilesFromEvent: PropTypes.func,
  maxFiles: PropTypes.number,
  maxSize: PropTypes.number,
  minSize: PropTypes.number,
  noClick: PropTypes.bool,
  noDrag: PropTypes.bool,
  noDragEventsBubbling: PropTypes.bool,
  noKeyboard: PropTypes.bool,
  onDrop: PropTypes.func,
  onDropAccepted: PropTypes.func,
  onDropRejected: PropTypes.func,
  onFileDialogCancel: PropTypes.func,
  onRemove: PropTypes.func,
  onRemoveAll: PropTypes.func,
  onUpload: PropTypes.func,
  preventDropOnDocument: PropTypes.bool,
};

OrganisationLogoDropzone.defaultProps = {
  files: [],
};
